import { Link } from "@mui/material";
import React from "react";

const linkArr = ["Home", "Service", "Feature", "Product", "Testimonial", "FAQ"];

const StyledLink = () => {
  return linkArr?.map((link) => {
    <Link href="#" color="inherit" underline="none">
      {link}
    </Link>;
  });
};

export default StyledLink;
